import React from "react";

class MyInputComponent extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      inputValue: "",
    };
  }

  render() {
    return (
      <div>
        <input type="text" />
      </div>
    );
  }
}

export default MyInputComponent;
